import React from 'react'
import Todos from './Todos'
import style from '../css/home.module.css';

const dummyTodos = [
    {

        id:1,
        title:'title one',
        desc:'title description one....'
        },

    {

        id:2,
        title:'title two',
        desc:'title description two....'
        }

    ]
    


function Home() {
  return (
    <div className={style.container}>
      <Todos  todos={dummyTodos} />
    </div>
  )
}

export default Home
